import axios from "axios";

export const createUser = () => {
  return dispatch => {
    return axios.get("http://localhost:3001/users").then(response => {
      dispatch(getUsers(response.data));
    });
  };
};

export const getUsers = users => {
  return {
    type: "GET_USERS",
    users: users
  };
};
